import React from 'react';
import { Link } from 'react-router-dom';
import './index';

const Home = () => {
  return (
    <div>
      <center>
        <h3>Welcome to home page</h3>
        <Link to='/dashboard' className='Link' >Dashboard</Link> {" "}
        <Link to='/about' className='Link'>About</Link>
      </center>
    </div>
  )
}

export default Home
